import React from "react";
import "../../src/Dashboard.css";

const Dashboard = () => {

  const handleLogin = async (e) => {
    e.preventDefault();
    const response = await fetch("http://localhost:8000/auth/login/", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData),
    });

    if (response.ok) {
      const data = await response.json();
      localStorage.setItem("token", data.token);
      navigate("/dashboard");
    } else {
      alert("Invalid credentials!");
    }
  };


  return (
    <div className="dashboard-container">
      <aside className="sidebar">
        <h2>WonsultingAI</h2>
        <button onClick={handleProfile}>Profile</button>
        <button className="start-btn">+ Start New Interview</button>
        <nav>
          <ul>
            <li>Home</li>
            <li>ResumeAI</li>
            <li>CoverLetterAI</li>
            <li>NetworkAI</li>
            <li>AutoApplyAI</li>
            <li className="active">InterviewAI</li>
            <li>Help</li>
            <li>Settings</li>
          </ul>
        </nav>
        <button className="premium-btn">Premium User</button>
      </aside>

      <main className="main-content">
        <div className="top-section">
          <div className="card">
            <h3>Most Recent</h3>
            <p>Finance Analyst at Tesla</p>
            <p>13 min | 7 questions</p>
            <button>Start Interview</button>
          </div>
          <div className="card">
            <h3>Most Recent</h3>
            <p>Finance Analyst at Google</p>
            <p>15 min | 9 questions</p>
            <button>Start Interview</button>
          </div>
        </div>

        <div className="progress-section">
          <h3>15 Interviews Completed</h3>
          <div className="progress-graph">
            <div className="bar" style={{ height: "50%" }}></div>
            <div className="bar" style={{ height: "70%" }}></div>
            <div className="bar" style={{ height: "80%" }}></div>
            <div className="bar" style={{ height: "90%" }}></div>
          </div>
        </div>
      </main>

      <aside className="score-section">
        <div className="score">90</div>
        <h3>Average Interview Score</h3>
        <p>Content: 80%</p>
        <p>Speech: 40%</p>
        <p>Facial Emotions: 20%</p>
        <p className="feedback">Improve your non-verbal cues. Aim to show positive emotions like excitement.</p>
      </aside>
    </div>
  );
};

export default Dashboard;
